import { useState } from "react";

const Home = () => {
  const [name, setName] = useState("Guy");

  const handleClick = () => {
    setName("Hello guy");
  };

  return (
    <div className="home">
      <h2>Home Page</h2>
      <p>{name}</p>
      <button onClick={handleClick}>Click here</button>
    </div>
  );
};

export default Home;
